    setShow((prev) => !prev);
  }
  return (
    <>
      {show !== true ? (
        <> </>
      ) : (
        <tr>
          <td className="item-id">AAAAAA</td>
          <td className="email">Pamonha@gmail.com</td>
          <button onClick={removeElement} className="remove-item">
            X
          </button>
        </tr>
      )}
    </>
  );
};

export default AdminUserItem;
